                "id": 18,
                "title": "<p>如图所示，BOD是半圆的水平直径，OC为竖直半径，半圆半径为R．现有质量相同的A、B小球分别从A、B两点以一定的初速度水平抛出，分别击中半圆轨道上的D点和C点，已知B球击中C点时动能为E<sub>k</sub>，不计空气阻力，则A球击中D点时动能为<ins>　</ins><ins> SHAPE \\* MERGEFORMAT </ins><ins> </ins><ins>  　</ins>；A、B小球与轨道碰撞前瞬间，重力的瞬时功率之比为<ins>　  </ins><ins>　</ins></p><p><img src=\"https://oss-cn-beijing.aliyuncs.com/zm-tiku/qb_prod/20171223201311_7323.jpg\" ></p>",
                "optionList": [],
                "answerList": [],
                "analysis": "<p>两个小球都做平抛运动，下落的高度相同都是R，根据R= SHAPE #\\* MERGEFORMAT  12gt2#\\frac{1}{2}g{{t}^{2}}21​gt2可知，运动的时间为：t= SHAPE #\\* MERGEFORMAT 2Rg#\\sqrt{#\\frac{2R}{g}}g2R​<path d=\"M1001 0h398999v40H1013.084S929.667 308 749 880s-277 876.333-289 913c-4.667 4.667-12.667 7-24 7h-12c-1.333-3.333-3.667-11.667-7-25-35.333-125.333-106.667-373.333-214-744-10 12-21 25-33 39l-32 39c-6-5.333-15-14-27-26l25-30c26.667-32.667 52-63 76-91l52-60 208 722c56-175.333 126.333-397.333 211-666s153.833-488.167 207.5-658.5C944.167 129.167 975 32.667 983 10c4-6.667 10-10 18-10zm0 0h398999v40H1013z\"></path>​，根据图象可知，A球运动的水平位移为2R，则A球的初速度为： SHAPE #\\* MERGEFORMAT vA=2Rt=2gR{{v}#_{A}}=#\\frac{2R}{t}=#\\sqrt{2gR}vA​=t2R​=2gR<path d=\"M95 622c-2.667 0-7.167-2.667-13.5-8S72 604 72 600c0-2 .333-3.333 1-4 1.333-2.667 23.833-20.667 67.5-54s65.833-50.333 66.5-51c1.333-1.333 3-2 5-2 4.667 0 8.667 3.333 12 10l173378c.667 0 35.333-71 104-213s137.5-285 206.5-429S812 17.333 812 14c5.333-9.333 12-14 20-14h399166v40H845.272L620 507 385 993c-2.667 4.667-9 7-197-6 0-10-1-12-3L160 575l-65 47zM834 0h399166v40H845z\"></path>​， B球的水平位移为R，则B球的初速度为： SHAPE #\\* MERGEFORMAT VB=Rt=12gR{{V}#_{B}}=#\\frac{R}{t}=#\\sqrt{#\\frac{1}{2}gR}VB​=tR​=21​gR<path d=\"M1001 0h398999v40H1013.084S929.667 308 749 880s-277 876.333-289 913c-4.667 4.667-12.667 7-24 7h-12c-1.333-3.333-3.667-11.667-7-25-35.333-125.333-106.667-373.333-214-744-10 12-21 25-33 39l-32 39c-6-5.333-15-14-27-26l25-30c26.667-32.667 52-63 76-91l52-60 208 722c56-175.333 126.333-397.333 211-666s153.833-488.167 207.5-658.5C944.167 129.167 975 32.667 983 10c4-6.667 10-10 18-10zm0 0h398999v40H1013z\"></path>​， A球从A到D的过程中，根据动能定理得： SHAPE #\\* MERGEFORMAT EK=mgR+12mvB2=54mgR{{E}#_{K}}=mgR+#\\frac{1}{2}mv#_{B}^{2}=#\\frac{5}{4}mgREK​=mgR+21​mvB2​=45​mgR…①， B球从B到C的过程中，根据动能定理得： SHAPE #\\* MERGEFORMAT EKD=mgR+12mvB2=2mgR{{E}#_{KD}}=mgR+#\\frac{1}{2}mv#_{B}^{2}=2mgREKD​=mgR+21​mvB2​=2mgR…②，由①②得： SHAPE #\\* MERGEFORMAT EKD=85EK{{E}#_{KD}}=#\\frac{8}{5}{{E}#_{K}}EKD​=58​EK​， A、B小球与轨道碰撞前瞬间，竖直方向速度v<sub>y</sub>=gt，相等，则重力的瞬时功率也相同，即重力的瞬时功率之比为1：1故答案为： SHAPE #\\* MERGEFORMAT 85#\\frac{8}{5}58​E<sub>k</sub>；1：1</p>",
